sys_variable_value.value:
(function execute(inputs, outputs) {
    // Query the onboarding case by 'number' field
    var gr = new GlideRecord('x_snc_ai_agents_0_fso_sma_onboarding');
    gr.addQuery('number', inputs.casenumber);
    gr.query();

    if (gr.next()) {
        // Get display values for assigned_to and opened_by
        outputs.assigned_to_name = gr.getDisplayValue('assigned_to');
        outputs.opened_by_name = gr.getDisplayValue('opened_by');
    } else {
        outputs.assigned_to_name = '';
        outputs.opened_by_name = '';
        gs.info('[Flow Step] No onboarding case found for Case Number: ' + inputs.casenumber);
    }
})(inputs, outputs);

